snippet.description:
R-Type™ Dimensions EX will be launching worldwide on Nintendo Switch™ and Steam on November 28, 2018. R-Type Dimensions includes both acclaimed arcade classics initially published by Irem, R-Type and R-Type II. Each title can be played in classic mode with the original 2D graphics and retro music or with hi-res 3D graphics and remastered audio.

For more information visit;
http://www.tozaigames.com/r-type-dime...

